        public static long beautifulSubarrays(int[] nums) {
            int len = nums.length;

            HashMap<Integer, Integer> mp = new HashMap<>();
            int[] prefix = new int[len];
            long count = 0;

            prefix[0] = nums[0];
            for (int i = 1; i < len; i++) {
                prefix[i] = prefix[i-1] ^ nums[i];
            }

            for (int i = 0; i < len; i++) {
                if (prefix[i] == 0) count++;

                if (mp.containsKey(prefix[i])) {
                    count += mp.get(prefix[i]);
                    mp.put(prefix[i], mp.get(prefix[i])+1   );
                } else {
                    mp.put(prefix[i], 1);
                }

            }
            return count;


        }


